**Describe the bug**
Hi team,
When invoking the run method in a for loop in one thread using the Java API, the GPU memory consumption stays at a low level and unchanged, which is expected.

However, when using a thread pool with multiple threads (e.g., 30 threads) to invoke the Run() method on the same inference session object simultaneously, the GPU memory consumption keeps increasing until all the GPU memory is used up. Is this expected?

**Urgency**
If there are particular important use cases blocked by this or strict project-related timelines, please share more information and dates. If there are no hard deadlines, please specify none.
None

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Linux Ubuntu 16.04
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: 1.6.0
- Python version:
- Visual Studio version (if applicable):
- GCC/Compiler version (if compiling from source):
- CUDA/cuDNN version: CUDA 11.0, cuDNN 8.0.5
- GPU model and memory: V100, 16G

**To Reproduce**
- Describe steps/code to reproduce the behavior.
- Attach the ONNX model to the issue (where applicable) to expedite investigation.

Some code snippet below that would cause the all the GPU memory to be used:

```
Mat mat = Imgcodecs.imread(inputImagePath, Imgcodecs.CV_LOAD_IMAGE_COLOR);
int numOfThreads = 30;
int trials = 30;
Executor executor = Executors.newFixedThreadPool(numOfThreads);
CountDownLatch countDownLatch = new CountDownLatch(trials);
for (int i = 0; i < trials; i++) {
    executor.execute(() -> {
        ObjectDetection.detectObjectsYoloV4(mat);
        countDownLatch.countDown();
    });
}

try {
    countDownLatch.await();
} catch (InterruptedException e) {
    e.printStackTrace();
}
```
